import React from 'react';

const ContactPage = () => (
  <div style={'font-size: 32px'}>
    <div>Hi, this is just a portfolio. My name is Nguyen Quoc Khanh and you can contact me at:</div>
    <span>Email: quockhanhnguyen.it@gmail.com</span>
  </div>
);

export default ContactPage;
